            WriteLiteral(@"</div>

<script>
    $(function () {
        $.ajax({
            type: 'get',
            url: '/Search/GetSalePrice',
            data: {},
            dataType: 'JSON',
            cache: true,// 开启ajax缓存
            success: function (data) {
                if (data.success) {
                    FlushPrice(data);
                }
            }
        });
    });
    function FlushPrice(data) {
        var discount = data.Discount;
        var selfShopid = data.SelfShopId;
        //会员价
        $(""#plist .pprice[shopId='"" + selfShopid + ""']"").each(function () {
            var disprice = parseFloat($(this).attr(""price"")) * parseFloat(discount);
            var showdisprice = disprice.toFixed(3);
            $(this).text(""￥"" + MoneyRound(parseFloat(showdisprice)));
        });
        //限时购
        $(data.LimitProducts).each(function () {
            $(""#plist .pprice[productId='"" + this.ProductId + ""']"").text(""￥"" + this.MinPrice.toFixed(2));
        });
    }
</script>");
